import React from 'react'

const Todo = () => {
    const cars = [
        { name: 'Toyota' },
        { name: 'Honda' },
        { name: 'BMW' },
        { name: 'Mercedes-Benz' },
        { name: 'Ford' },
        { name: 'Chevrolet' },
        { name: 'Audi' },
        { name: 'Nissan' },
        { name: 'Volkswagen' },
        { name: 'Tesla' },
    ];
    return (
        <div>
            {
                cars.map((n) => (
                    <div>
                        <h2>{n.name}</h2>
                    </div>
                ))
            }
        </div>
    )
}

export default Todo
